import React from "react";
import ReactDOM from "react-dom";

const img = "https://picsum.photos/230";
ReactDOM.render(
  <>
    <h1 className="heading">My favourite foods</h1>
    <img src={img}></img>
  </>,
  document.getElementById("root")
);
